import { useState } from 'react';
function Index() {

  let data = localStorage.getItem("user-info");
  data = JSON.parse(data);
  async function getMerchants() {
    let [merchants, setMerchants] = useState([{}]);
    let result = await fetch("http://localhost:3001/api/v1/merchants", {
      method: 'GET',
      headers: {
        "Content-Type": 'application/json',
        "Accept": 'application/json',
        "uid": data['uid'],
        "client": data['client'],
        "access-token": data['access_token']
      }
    });

    result = await result.json();
    setMerchants(result);
  }

  return (
    <>
      <div className="flex flex-inline justify-center justify-item-center">
        Merchants
      </div>

      <div>
        <table className="table table-striped">
          <thead>
            <tr>
              <th>Id</th>
              <th>Name</th>
              <th>Address</th>
              <th>Phone</th>
            </tr>
          </thead>
          <tbody>
            {merchants.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.address}</td>
                <td>{item.phone}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        <button className="btn btn-primary" onClick={getMerchants}
          >Get Merchants
          </button>
      </div>
    </>

  );
}

export default Index;
